import { styled } from './stitches.config';

const Link = styled('a', {
    fontWeight: '700',
    color: 'inherit',
    textDecoration: 'none',
    lineHeight: '25px',
    transition: 'all 0.1s ease',
    outline: 'none',
})

interface ReadingsProps {
    link: string
    text: string
}

const Reading = ({link, text}: ReadingsProps) => {
    return(
        <li>
            <Link href={link}>{text}</Link>
        </li>
    )
}

export default Reading;
